import React from 'react';

const About = () => {
    return (
        <>
            <section>
                <h2>Trusted and loved by the world's best teams</h2>
                <ul className="text-secondary d-flex outline-none">
                    <li>wetransfer</li>
                    <li>stamps</li>
                    <li>manter</li>
                    <li>sugarcane</li>
                </ul>
            </section>
        </>
    );
};

export default About;
